import React from 'react';
import { useParams } from 'react-router-dom';

export const EditUser = () => {
	let { id } = useParams();

	return (
		<div>
			<h2>Editar Usuario</h2>
			<p>ID del usuario a editar: {id}</p>
		</div>
	);
};
